import React from "react";

const className = "margin-5 padding-5";

export default function Signup({ goToLogin }) {
  const handleSubmit = () => {
    alert("signed up!");
  };
  return (
    <div>
      <h1>Sign Up</h1>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          name="email"
          placeholder="email"
          className={className}
        />
        <input
          type="text"
          name="password"
          placeholder="password"
          className={className}
        />
        <button type="submit" className={className + " submitButton"}>
          Sign Up
        </button>
      </form>
      <div className={className + " outlinedButton"} onClick={goToLogin}>
        Login
      </div>
    </div>
  );
}
